import React, { useState } from 'react';
import axios from 'axios';
import { useHistory } from 'react-router-dom';
import { Button, Input, Select, FormControl, FormLabel, Textarea, Box } from '@chakra-ui/react';

const PaymentsPage = () => {
    const [amount, setAmount] = useState('');
    const [currency, setCurrency] = useState('USD');
    const [payeeAccount, setPayeeAccount] = useState('');
    const [swiftCode, setSwiftCode] = useState('');
    const [loading, setLoading] = useState(false);
    const [errorMessage, setErrorMessage] = useState('');
    const history = useHistory();

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setErrorMessage('');
        try {
            const token = localStorage.getItem('authToken'); // Assuming token is stored in localStorage
            const response = await axios.post(
                'http://your-backend-url/transactions',
                {
                    amount,
                    currency,
                    provider: 'SWIFT',
                    payeeAccount,
                    swiftCode,
                },
                {
                    headers: {
                        Authorization: `Bearer ${token}`,
                    },
                }
            );
            alert('Transaction Created Successfully');
            history.push('/transactions'); // Redirect to transactions page
        } catch (error) {
            setErrorMessage(error.response ? error.response.data.message : 'An error occurred');
        } finally {
            setLoading(false);
        }
    };

    return (
        <Box padding="5" maxWidth="600px" margin="0 auto">
            <h2>Create a Transaction</h2>
            <form onSubmit={handleSubmit}>
                {errorMessage && <div style={{ color: 'red' }}>{errorMessage}</div>}
                <FormControl isRequired>
                    <FormLabel htmlFor="amount">Amount</FormLabel>
                    <Input
                        id="amount"
                        type="number"
                        value={amount}
                        onChange={(e) => setAmount(e.target.value)}
                        min="0"
                        placeholder="Enter amount"
                    />
                </FormControl>
                <FormControl isRequired marginTop="4">
                    <FormLabel htmlFor="currency">Currency</FormLabel>
                    <Select
                        id="currency"
                        value={currency}
                        onChange={(e) => setCurrency(e.target.value)}
                    >
                        <option value="USD">USD</option>
                        <option value="EUR">EUR</option>
                        <option value="AUD">AUD</option>
                        <option value="CAD">CAD</option>
                        <option value="GBP">GBP</option>
                    </Select>
                </FormControl>
                <FormControl isRequired marginTop="4">
                    <FormLabel htmlFor="payeeAccount">Payee Account</FormLabel>
                    <Input
                        id="payeeAccount"
                        type="text"
                        value={payeeAccount}
                        onChange={(e) => setPayeeAccount(e.target.value)}
                        placeholder="Enter Payee Account"
                    />
                </FormControl>
                <FormControl isRequired marginTop="4">
                    <FormLabel htmlFor="swiftCode">SWIFT Code</FormLabel>
                    <Input
                        id="swiftCode"
                        type="text"
                        value={swiftCode}
                        onChange={(e) => setSwiftCode(e.target.value)}
                        placeholder="Enter SWIFT Code"
                    />
                </FormControl>
                <Box marginTop="4">
                    <Button colorScheme="blue" type="submit" isLoading={loading}>
                        {loading ? 'Processing...' : 'Submit'}
                    </Button>
                </Box>
            </form>
        </Box>
    );
};

export default PaymentsPage;
